import React from 'react';
import { Card, CardBody, CardText, CardTitle } from 'reactstrap';
import { getCurrentDayOfWeek, getCurrentTimeSlot } from './Roster';
import variables from '../variables';

// Function to fetch unverified students count
const fetchUnverifiedCount = () => {
    return fetch(variables.API_URL + 'unverified/')
       .then(response => {
         if (!response.ok) {
           throw new Error('Network response was not ok');
         }
         return response.json();
       })
       .then(data => {
         console.log(data); // Log the entire response data
         return data.length; // Return the count of unverified students
       })
       .catch(error => {
         console.error('Error:', error);
       });
   };
   
   // Function to fetch the currently available doctor
const fetchAvailableDoctor = () => {
    const currentDayOfWeek = getCurrentDayOfWeek();
    const currentTimeSlot = getCurrentTimeSlot();
   
    return fetch(variables.API_URL + 'roster/')
       .then(response => {
         if (!response.ok) {
           throw new Error('Network response was not ok');
         }
         return response.json();
       })
       .then(rosterList => {
         console.log(rosterList); // Log the entire response data
         // Find the roster for the current day and time slot
         const currentRoster = rosterList.data.find(roster => 
           roster.dayslot.day === currentDayOfWeek && roster.dayslot.slot === currentTimeSlot
         );
         // Return the doctor from the current roster, or null if no roster found
         return currentRoster ? currentRoster.doctor : null;
       })
       .catch(error => {
         console.error('Error:', error);
       });
   };
   const fetchRegisteredStudents = () => {
    return fetch(variables.API_URL + 'user/')
       .then(response => {
         if (!response.ok) {
           throw new Error('Network response was not ok');
         }
         return response.json();
       })
       .then(data => {
         if ('data' in data && Array.isArray(data.data)) {
           const students = data.data.map(student => {
             if (!student.is_staff && !student.is_superuser && !student.verified) {
               return student;
             }
             return null;
           }).filter(student => student !== null); // Remove undefined values
           return students.length; // Return the count of registered students
         } else {
           throw new Error('Unexpected data format');
         }
       })
       .catch(error => {
         console.error('Error:', error);
       });
   };

   
   

class Home extends React.Component {
 constructor(props) {
    super(props);
    this.state = {
      unverifiedCount: 0,
      availableDoctor: null,
      registeredStudentsCount: 0,
    };
 }

 componentDidMount() {
    Promise.all([fetchUnverifiedCount(), fetchAvailableDoctor(), fetchRegisteredStudents()])
      .then(([unverifiedCount, availableDoctor, registeredStudentsCount]) => {
        this.setState({ unverifiedCount, availableDoctor, registeredStudentsCount, forceUpdate: !this.state.forceUpdate }, () => {
          console.log("Unverified Count: ", unverifiedCount);
          console.log("Available Doctor: ", availableDoctor);
          console.log("Registered Students Count: ", registeredStudentsCount);
        });
      });
 }


 render() {
    const { unverifiedCount, availableDoctor, registeredStudentsCount } = this.state;

    return (
      <div>
        <div style={{ display: 'flex', gap: '1rem' }}>
        <Card className="float-start">
          <CardBody>
            <CardTitle tag={'h5'}>Students to Be Verified</CardTitle>
            <CardText>
            {unverifiedCount}
            </CardText>
          </CardBody>
        </Card>

        <Card className="float-start">
          <CardBody>
            <CardTitle tag={'h5'}>Doctor On Duty</CardTitle>
            <CardText>
               {availableDoctor ? availableDoctor.doctor_name : 'N/A'}
            </CardText>
          </CardBody>
        </Card>

        <Card className="float-start">
          <CardBody>
          <CardTitle tag={'h5'}>Registered Students</CardTitle>
            <CardText>
               {registeredStudentsCount}
            </CardText>
          </CardBody>
        </Card>

        <Card>
          <CardBody>
          <CardTitle tag={'h5'}>Current Slot</CardTitle>
            <CardText>
               {getCurrentTimeSlot()}
            </CardText>
          </CardBody>
        </Card>
        </div>
      </div>
    );
 }
}

export default Home;
